import React from 'react';
import { handleIconError } from '../services/IconResolver';
import '../styles/azure-theme.css';

const DraggableService = ({ service, onClick }) => {
  return (
    <div 
      className="draggable-service azure-border"
      onClick={onClick}
    >
      <div className="service-icon">
        <img 
          src={service.icon}
          alt={service.name}
          onError={(e) => handleIconError(e, service.name)}
          style={{
            width: '48px',
            height: '48px',
            display: 'block'
          }}
        />
      </div>
      <span className="service-name azure-glow">{service.name}</span>
    </div>
  );
};

export default DraggableService;
